version: "1"

package:
  id: org.deepin.camera
  name: "deepin-camera"
  version: 6.5.15.1
  kind: app
  description: |
    camera for deepin os.

base: com.uniontech.base/25.2.0/arm64
runtime: com.uniontech.runtime.dtk/25.2.0/arm64

command:
  - deepin-camera

build: |
  bash ./install_dep linglong/sources "${PREFIX}"

  # 移动部分库到应用库目录，否则无法找到
  mv ${PREFIX}/lib/${TRIPLET}/blas/* ${PREFIX}/lib/${TRIPLET}
  mv ${PREFIX}/lib/${TRIPLET}/lapack/* ${PREFIX}/lib/${TRIPLET}
  ldconfig -C "$LINGLONG_LD_SO_CACHE"

  # 修改路径
  find . -type f -name "*.service" -exec sed -i 's|^Exec=.*|Exec=deepin-camera|g' {} +

  # 构建
  VERSION=$(head -1 debian/changelog | awk -F'[()]' '{print $2}')
  cmake -B build ${conf_args} \
        -DCMAKE_BUILD_TYPE=Release \
        -DCMAKE_INSTALL_PREFIX=${PREFIX} \
        -DCMAKE_INSTALL_LIBDIR=${PREFIX}/lib/${TRIPLET} \
        -DVERSION=${VERSION} \
        -DLINGLONG_BUILD_ON=1
  cmake --build build -j`nproc`
  cmake --build build --target install > install.log 2>&1

  # 项目生成应用名和动态隐式加载的依赖库，ldd无法找到的其他库
  LDD_FILES=(
    deepin-camera
    libv4l2.so
    libportaudio.so
    libusb-1.0.so
    # 已包含在 runtime 中
    # libudev.so
    libavutil.so
    libavformat.so
    libswscale.so
    libswresample.so
    libffmpegthumbnailer.so
    libavcodec.so
    ../libdeepin-event-log.so
  )

  # 生成.install 文件
  bash ./deploy_dep "${LDD_FILES[@]}"

